import React from "react";
import "./Destination.css";
import Mountain1 from "../images/1.jpg";
import Mountain2 from "../images/2.jpg";
import DestinationData from "./DestinationData";

export default function Destination() {
  return (
    <div className="destination">
      <h1>Popular Destinations</h1>
      <p>Tours give you the opportunity to see a lot, within a time frame.</p>
      <DestinationData
        heading="Taal Valcano, Batangas"
        text="One of the most iconic views in Luzon, Mt. Taal boasts a valcano
            inside a lake inside an island. If you fancy a closer look, the hike
            up to the crater is a mere 45 minutes, and is easy enough for
            beginners. Guides will assist you most of the way and you'll see the
            peculiar environment found on an active volcano, including volcanic
            rocks and steam vents. The hike can be dusty and hot, so plan for an
            early morning trip, and then unwind with some bulalo before heading
            back home!"
        img1={Mountain1}
        img2={Mountain2}
      />
      <DestinationData
        heading="Mt. Daguldul, Batangas"
        text="If you're looking for a hike that's a little more challenging but still good for a beginner mountaineer, check out Mt.Da"
        img1={Mountain1}
        img2={Mountain2}
      />
    </div>
  );
}
